import React, { Component } from "react";
import TopBar from "../../Nav/TopBar/TopBar";
import LeftBar from "../../Nav/LeftBar/LeftBar";
import NavItem from "../../Nav/NavItem/NavItem";
import MainContainer from "../../MainContainer/MainContainer";

export default class AppSettings extends Component {
   state = {
      theme: this.props.theme
   };

   render() {
      return (
         <div>
            <TopBar theme={this.state.theme} />
            <LeftBar theme={this.state.theme}>
               <NavItem icon="fa fa-signal" />
               <NavItem icon="fa fa-users" />
               <NavItem icon="fa fa-check-square " />
               <NavItem icon="fa fa-download" />
               <NavItem icon="fa fa-upload" />
               <NavItem icon="fas fa-sign-out-alt" />
            </LeftBar>
            <MainContainer />
         </div>
      );
   }
}
